import React from "react";

function Appointment() {
  return (
    <div>
      <div style={{display: 'flex', flexDirection: 'row'}}>
        <img src="https://remedoapp.com/rweb/assets/default/images/doctor_female.svg" style={{height: '15%', width: '15%', margin: '2%'}} />
        <div style={{margin: '2%'}}>
            <h5>Dr. Manik Dalvi</h5>
            <h5>Obstetrics & Gynecology</h5>
            <button type="button" class="btn btn-primary">View profile</button>
        </div>
      </div>
      <hr />
      <div style={{display: 'flex', flexDirection: 'row'}}>
        <div>
            <h5>Book Appointment</h5>
            <h5 style={{color: 'grey'}}>Select Your Consultation Type</h5>
            <p style={{color: '#20c997', fontWeight: 'bold'}}>Fees Rs 500</p>
            <p style={{color: '#715ac4', fontWeight: '600'}}>(pay at clinic)</p>
        </div>
        <div style={{height: '10px', width: '10px'}}>
            {/* https://remedoapp.com/rweb/assets/default/images/svg-img/new-img/In-Clinic_b.png */}
            <img src="https://remedoapp.com/rweb/assets/default/images/svg-img/new-img/In-Clinic.png" style={{height: '5rem', width: '5rem'}}/>
            {/*https://remedoapp.com/rweb/assets/default/images/svg-img/new-img/Audio_b.png*/}
            <img src="https://remedoapp.com/rweb/assets/default/images/svg-img/new-img/Audio.png" style={{height: '5rem', width: '5rem'}}/>
            {/*	https://remedoapp.com/rweb/assets/default/images/svg-img/new-img/video_b.png*/}
            <img src="https://remedoapp.com/rweb/assets/default/images/svg-img/new-img/video.png" style={{height: '5rem', width: '5rem'}}/>
        </div>
      </div>
    </div>
  );
}

export default Appointment;
